@JoeBiomed @C_Kochansky @OttawaPolice So instead of holding the leaders to a higher standard ethically and morally you are arguing "better the devil I know..."
I'm sure if you take a step back you can think a little less black and white.
I believe in you!

@hodgetwins Yes they can, it sucks, but wouldn't have it any other way.
How would you suggest exceptions are determined? How would you police it?
You can't.

@AndrewSteinwold Change that to living then your argument will go further.
Technically powerful people further back (Ghengis Khan for instance) have had a much greater impact because of compound over centuries.
Elons cool though, done lots, hope he will do much more.

@JustWazzaXRP Your numbers for a first video are very good, your expectations may need a reality check. 
Keep working on good content, build a core viewership that tune in, and it'll all come in time.
But you need to do it because you like doing it, if it's number driven dopamine hits...stop

@RogelioHealer @woofBIGDAWG Not defending him, just my opinion. I lost a large chunk of funds in Sepa. 
Just looking back and reading last communication it stinks of depression, and that's a hole that's hard for people to function from.
We are quick to call people a villain when maybe he just fell apart.

@RogelioHealer @woofBIGDAWG Don't agree that it was rugged exactly. Chicago brokers sister died, he got COVID and had before then lost all momentum for market penetration.
Think it was the personal stuff + project beyond his skillset which lead to failure.
Some businesses just fail.

